import RatingBox from "./RatingBox";
import React, { useState } from "react";

function App() {
  const [rating, setRating] = useState(0);
  return rating ? (
    <div style={{ color: "red" }}>{rating}</div>
  ) : (
    <RatingBox setRating={setRating}></RatingBox>
  );
}

export default App;
